  name: 🇭🇰 香港节点
  type: select
- filter: (?i)日|jp|japan
  include-all: true
  name: 🇯🇵 日本节点
  type: select
- filter: (?i)美|us|unitedstates|united states
  include-all: true
  name: 🇺🇲 美国节点
