  url: https://www.google.com/generate_204
- filter: (?=.*(日|JP|(?i)Japan))^((?!(港|台|韩|新|美)).)*$
  include-all: true
  interval: 300
  name: ♻️ 日本自动
  type: url-test
  url: https://www.google.com/generate_204
- filter: (?=.*(美|US|(?i)States|America))^((?!(港|台|日|韩|新)).)*$
